import CartIcon from '../Cart/CartIcon';
import styles from './Header.module.css';

const HeaderCartButton = () => {
  return (
    <button>
      <span>
        <CartIcon />
      </span>
      <span>Your Cart</span>
      <span>3</span>
    </button>
  );
};

export default HeaderCartButton;
